#include<iostream>
#include<string>
#include<vector>
#include <stdio.h>
#include <stdlib.h>
#include <time.h>
#include <algorithm>


int main() {
	std::vector<int> so;
	int N;
	std::cin >> N;
	for (int i = 2; i < N; i++) {
		bool aho = true;
		for (int j = 0; j < so.size(); j++) {
			if (i % so[j] == 0) {
				aho = false;
				break;
			}
		}
		if (aho)so.push_back(i);
	}
	std::cout << so.size() << std::endl;
	return 0;
}
